                <div className='footer-content'>
                    <div className='custormer'>
                        <h3 className='mb-5 text-black font-medium  text-2xl'>Customer</h3>
                        <span className='mb-5 text-black font-normal  text-sm w-[120px]'>Help & Contact Us Returns & Refunds Online Stores Terms & Conditions</span>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Footer;
